import React from 'react';
import './App.css';
import {fetchApi} from './apiCalls'

function App() {
  const routeData = fetchApi('routes')
  setTimeout(console.log(fetchApi('routes')), 0);

  return (
    <div className="App">
      <select className="select-box">
        { routeData.map(route => {
          return <option>Select</option>
        })
      }
      </select>
    </div>
  );
}

export default App;
